import React, { useState } from 'react';
import { 
  Navbar, 
  NavbarBrand, 
  Nav, 
  NavItem, 
  NavLink, 
  Container,
  Collapse,
  NavbarToggler
} from 'reactstrap';
import { Link } from 'react-router-dom';

const MyNavbar = ({ vertical = false }) => {
  const [isOpen, setIsOpen] = useState(false);
  const toggle = () => setIsOpen(!isOpen);

  // Deep green with a modern, slightly muted tone
  const navbarStyle = {
    backgroundColor: '#1E3A23', // Darker, more sophisticated green
    transition: 'all 0.3s ease'
  };

  return (
    <Navbar 
      dark 
      expand="md" 
      style={navbarStyle} 
      className={`${vertical ? 'flex-column vh-100 position-fixed start-0 top-0' : ''} shadow-sm`}
    >
      <Container fluid={vertical}>
        <NavbarBrand 
          href="/" 
          className="text-light fw-bold"
          style={{ letterSpacing: '1px' }}
        >
          Mi App
        </NavbarBrand>
        <NavbarToggler onClick={toggle} />
        <Collapse isOpen={isOpen} navbar>
          <Nav 
            className={`${vertical ? 'flex-column' : 'ms-auto'} align-items-start`} 
            navbar
          >
            <NavItem>
              <NavLink 
                tag={Link} 
                to="/" 
                className="text-light hover-effect"
              >
                Home
              </NavLink>
            </NavItem>
            <NavItem>
              <NavLink 
                tag={Link} 
                to="/about" 
                className="text-light hover-effect"
              >
                About
              </NavLink>
            </NavItem>
            <NavItem>
              <NavLink 
                tag={Link} 
                to="/services" 
                className="text-light hover-effect"
              >
                Services
              </NavLink>
            </NavItem>
          </Nav>
        </Collapse>
      </Container>
    </Navbar>
  );
};

export default MyNavbar;
